import React from 'react';
import styled from "styled-components";

const Container = styled("div")`
padding:20px;
`;

const FlexContainer = styled("div")`
display:flex;
`;

const CardContainer = styled(FlexContainer)`
padding-bottom:10px;
display:flex;
`;

const Title = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: bold;
font-size: 14px;
line-height: 19px;
color: #444444;
padding-top:10px
`;


const vehicles = [{
    imageUrl: require("../../assets/images/cars/vehicles/economy.svg"),
    name: "Economy",
    capacity: "4",
    price: "122",
    currency: "Birr",
}];

const VehicleList = () => {
    return (
        <>
            <Container>
                <Title>Select Vehicle</Title>

                {vehicles.map((vehicle) => (
                    <Card key={vehicle.name} />
                ))}
            </Container>

        </>
    );
}

export default VehicleList;
